import React, { Component } from 'react';
import PropTypes from 'prop-types';
import Typography from '@material-ui/core/Typography';
import {connect} from 'react-redux';
import {getRepos} from './../../reducers/repo.reducer';
import {getUser} from './../../reducers/user.reducer';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Idea from './components/ideaCard';

function TabContainer(props) {
  return (
    <Typography component="div" style={{ padding: "24px" }}>
      {props.children}
    </Typography>
  );
}

TabContainer.propTypes = {
  children: PropTypes.node.isRequired,
};

class ExploreIdeas extends Component {
  constructor(props) {
    super(props);
    this.state = {
      currentTab: 0,
      header: "Trending",
    };
  }

  handleTabChange  (tabNum) {

    if (tabNum === 0) {
      this.setState({ currentTab: 0 });
      this.setState({ header: "Trending" });
    }
    else if (tabNum === 1) {
      this.setState({ currentTab: 1 });
      this.setState({ header: "New" });
    }
    else if (tabNum === 2) {
      this.setState({ currentTab: 2 });
      this.setState({ header: "Most Funded" });
    }
  };

  render() {
    return (
      <div className="ExploreIdeas">
        <div className="PageTitle">
          <Typography id="overline">
          IDEAS
          </Typography>
          <Typography variant="display4">
          {this.state.header}
          </Typography>
          <Tabs value={this.state.currentTab} indicatorColor="primary">
            <Tab label="Trending" onClick={()=>this.handleTabChange(0)}/>
            <Tab label="New" onClick={()=>this.handleTabChange(1)}/>
            <Tab label="Most Funded" onClick={()=>this.handleTabChange(2)}/>
          </Tabs>
          <Idea/>
        </div>
      </div>
    );
  }
}

const mapStateToProps =(state) =>{
  return{
    repos: getRepos(state),
    user: getUser(state)
  }
}
export default connect(mapStateToProps)(ExploreIdeas);
